package com.jiyi.joke.bean;

public class UserCollectBean {
	private String usercollect_id;
	private String joke_id;
	private String user_id;
	private String type;
	public UserCollectBean() {
		// TODO Auto-generated constructor stub
	}
	
	public String getType() {
		return type;
	}

	public void setType(String type) {
		this.type = type;
	}

	public String getUsercollect_id() {
		return usercollect_id;
	}
	public void setUsercollect_id(String usercollect_id) {
		this.usercollect_id = usercollect_id;
	}
	public String getJoke_id() {
		return joke_id;
	}
	public void setJoke_id(String joke_id) {
		this.joke_id = joke_id;
	}
	public String getUser_id() {
		return user_id;
	}
	public void setUser_id(String user_id) {
		this.user_id = user_id;
	}
	
	

}
